def extract_precision_recall(l):
  precision = list([p for (p, _) in l])
  recall = list([r for (_, r) in l])
  zipped = sorted(zip(recall,precision))
  precision = [p for (_,p) in zipped]
  recall = [r for (r,_) in zipped]
  return  precision, recall

